INSERT INTO `detail_wisata` (`id`, `wisata_id`, `image`, `nama`, `harga`, `deskripsi`, `jenis_kalkulasi`, `created_at`, `updated_at`, `deleted_at`) VALUES
(36, 3, '1661358214_FILE_DETAIL_WISATA.jpg', 'Abeh Lagee Homestay', '750000', 'Fasilitas :\r\n-	Single Bed\r\n-	Handuk\r\n-	Perlengkapan shalat', 0, '2022-08-24 16:23:34', '2022-08-24 09:23:34', NULL),
(37, 4, '1661144089_FILE_DETAIL_WISATA.jpg', 'Rapai Geleng', '25000', 'Lekuk gerakan penari serta tabuhan alat musik rapa’i diiringi syair-syair yang dilantunkan secara bersamaan menghiasi malam-malam di gampong nusa. Ini merupakan satu lagi keunikan gampong nusa yang menghadirkan pertunjukan tari Rapa’i geleng di malam hari sebagaimana budaya di aceh. Wisatawan dapat menyaksikan pertunjukan tari yang disuguhkan oleh pemuda gampong. Setelah itu, wisatawan yang penasaran dengan cara memainkan rapa’i sambil melakukan gerakan tarian. Dapat pula berlatih bersama Al-Hayah.\r\nFasilitas :\r\n-	Narasumber\r\n-	Performance\r\n-	Belajar tarian', 1, '2022-08-22 04:54:49', '2022-08-21 21:54:49', NULL),
(38, 5, '1661144127_FILE_DETAIL_WISATA.jpg', 'Pizza Aceh', '30000', 'Pizza Aceh seperti itu kami menamakannya. Pizza Aceh atau biasa dikenal dengan sebutan \"Deudah\" merupakan sajian menu khas Aceh yang lezat dan sangat nikmat disantap dengan nasi putih hangat, berbahan utama telur bebek dan daun \"lingong\" dengan berbagai rempah-rempah lainnya yang dimasak dengan cara dipanggang tanpa menggunakan minyak. Anda dapat menikmati sajian ini sebagai menu utama makan siang Anda.', 1, '2022-08-22 04:55:27', '2022-08-21 21:55:27', NULL),
(39, 6, '1661144169_FILE_DETAIL_WISATA.jpg', 'Pengelolaan Sampah', '35000', 'Mengolah sampah-sampah menjadi produk bernilai jual tinggi seperti tas yang dirajut  dari limbah plastik kemasan. Wisatawan dapat ikut belajar cara mengolah sampah plastik menjadi handicraft dengan bantuan ibu-ibu gampong Nusa\r\nFasilitas :\r\n-	Narasumber\r\n-	Bahan\r\n-	Hasil karya', 1, '2022-08-22 04:56:09', '2022-08-21 21:56:09', NULL),
(40, 6, '1661144269_FILE_DETAIL_WISATA.jpg', 'Kreasi Oen Ue', '25000', 'Belajar membuat kerajinan dari daun kelapa.\r\n- Minimal 5 orang Rp. 25.000/ orang\r\n- Fasilitas : Narsum, hasil karya, bahan kerajinan.', 1, '2022-08-22 04:57:49', '2022-08-21 21:57:49', NULL),
(41, 7, '1661144324_FILE_DETAIL_WISATA.jpg', 'Hiking (Lhok Umpee)', '75000', 'Salah satu andalan dari atraksi panorama alam di nusa adalah bukit lhok empee. Wisatawan dapat menikmati pemandangan matahari terbit dari atas bukit. Sebelum menuju puncak bukit wisatawan akan menelusuri lahan sawah, kebun dan hamparan hijau rerumputan yang ikut menyejukkan pagi.\r\nFasilitas :\r\n-	Guide\r\n-	Snack\r\n-	Melihat sunrise/sunset', 1, '2022-08-22 04:58:44', '2022-08-21 21:58:44', NULL),
(42, 3, '1661144406_FILE_DETAIL_WISATA.jpg', 'Lala Homestay', '75000', 'Fasilitas :\r\n-	Single Bed\r\n-	Handuk\r\n-	Perlengkapan shalat', 0, '2022-08-22 05:00:06', '2022-08-21 22:00:06', NULL),
(43, 3, '1661144432_FILE_DETAIL_WISATA.jpg', 'Yana Homestay', '75000', 'Fasilitas :\r\n-	Double Bed\r\n-	Handuk\r\n-	Perlengkapan shalat', 1, '2022-08-22 05:00:32', '2022-08-21 22:00:32', NULL),
(44, 4, '1661144467_FILE_DETAIL_WISATA.jpg', 'Ratoh Jaroe', '25000', 'Tarian ini merupakan tari kreasi yang sering ditampilkan dalam acara penyambutan tamu penting di Aceh dan juga sebagai hiburan. Tarian ini dimainkan oleh penari perempuan dengan jumlah genap. Ratoh Jaroe ini dibuat secara khusus untuk membangkitkan semangat para wanita Aceh, yang dikenal pantang menyerah, pemberani, dan kompak satu sama lain. Tari ini juga memiliki arti yang mendalam, yaitu sebagai tarian yang mencerminkan puji-pujian dan zikir kepada Tuhan Yang Maha Esa. Wisatawan yang penasaran dengan gerakan tarian ratoh jaro, dapat pula berlatih bersama Al-Hayah. \r\n\r\nFasilitas : \r\n-	Narasumber\r\n-	Performance\r\n-	Belajar tarian', 1, '2022-08-22 05:01:07', '2022-08-21 22:01:07', NULL),
(45, 4, '1661144491_FILE_DETAIL_WISATA.jpg', 'Ranup Lampuan', '25000', 'Tari ranup lampuan merupakan salah satu tarian tradisi Aceh yang menggambarkan estetika dan etika yang tinggi di kalangan masyarakat Aceh dalam memberikan penghormatan kepada tamu. Biasanya tamu diterima dengan penuh hormat, disuguhi sirih. Hal ini terlihat melalui simbolik gerak tari penari, perlengkapan tari dan sirih yang disuguhkan kepada tamu. Melalui gerak tari terlihat gerak yang tertib dan lembut sebagai ungkapan kehidmatan mempersilahkan para tamu duduk, dan suguhan sirih adalah lambang persaudaraan, sebagai mukaddimah dari setiap hajat dalam pergaulan  hidup bermasyarakat. Tari ini ditarikan oleh 7 atau 9 penari wanita usia remaja. Sebagai pengiring tari ialah musik tradisional seperti Serune kale dan Geundrang.\r\nFasilitas :\r\n-	Narasumber\r\n-	Performance\r\n-	Belajar tarian', 1, '2022-08-22 05:01:31', '2022-08-21 22:01:31', NULL),
(46, 5, '1661144588_FILE_DETAIL_WISATA.jpg', 'Kuah Beulangong', '75000', 'Anda dapat menkmati kuah beulangong sebabai menu utama untuk makan siang/malam\r\nMinimal 5 pax', 1, '2022-08-22 05:03:08', '2022-08-21 22:03:08', NULL),
(47, 5, '1661144631_FILE_DETAIL_WISATA.jpg', 'Kuah Oen Murong', '25000', 'Kuah \"oen murong\" atau daun kelor merupakan masakan yang sangat erat kaitannya dengan masyarakat Aceh dikarenakan cerita rakyat \"Ahmad Rahmanyang\". Masakan ini sangat sederhana, hanya daun kelor dengan irisan bawang merah, biasanya juga ditambahkan irisan jagung. Anda dapat menkmati kuah oen murong sebabag menu utama untuk makan siang/malam', 1, '2022-08-22 05:03:51', '2022-08-21 22:03:51', NULL),
(48, 6, '1661144695_FILE_DETAIL_WISATA.jpg', 'Pengolahan Sunti', '25000', 'Belajar cara membuat/mengolah belimbing wuluh menjadi asam sunti, asam khas masyarakatAaceh\r\n- Minimal 5 orang Rp. 25.000/orang\r\n- Fasilitas : Narsum, belimbing wuluh, asam sunti', 1, '2022-08-22 05:04:55', '2022-08-21 22:04:55', NULL),
(49, 6, '1661144891_FILE_DETAIL_WISATA.jpg', 'Bank Sampah', '25000', 'Gampong Nusa juga memiliki Bank Sampah, tempat anak-anak menabung sampah. Layaknya bank moderen, setiap penabung memiliki buku tabungan sendiri. “Sampah yang dijual itu, digunakan untuk membayar iuran Taman Pendidikan Al Quran dan kegiatan lainnya. Sehingga, meringankan beban orangtua.”\r\nFasilitas :\r\n-	Narasumber', 1, '2022-08-22 05:08:11', '2022-08-21 22:08:11', NULL),
(50, 3, '1661145022_FILE_DETAIL_WISATA.jpg', 'Opi Homestay', '75000', 'Fasilitas :\r\n-	Single Bed\r\n-	Lemari pakaia\r\n-	Meja rias/belajar\r\n-	Handuk\r\n-	Perlengkapan shalat', 0, '2022-08-22 05:10:22', '2022-08-21 22:10:22', NULL),
(51, 3, '1661145069_FILE_DETAIL_WISATA.jpg', 'Anyak Homestay', '75000', 'Fasilitas :\r\n-	Single Bed\r\n-	Lemari pakaia\r\n-	Meja rias/belajar\r\n-	Handuk\r\n-	Perlengkapan shalat', 0, '2022-08-22 05:11:09', '2022-08-21 22:11:09', NULL),
(52, 3, '1661145087_FILE_DETAIL_WISATA.jpg', 'Bunda Homestay', '75000', 'Fasilitas :\r\n-	Single Bed\r\n-	Lemari pakaia\r\n-	Meja rias/belajar\r\n-	Handuk\r\n-	Perlengkapan shalat', 0, '2022-08-22 05:11:27', '2022-08-21 22:11:27', NULL),
(53, 3, '1661145112_FILE_DETAIL_WISATA.jpg', 'Syakila Homestay', '75000', 'Fasilitas :\r\n-	Single Bed\r\n-	Lemari pakaia\r\n-	Meja rias/belajar\r\n-	Handuk\r\n-	Perlengkapan shalat', 0, '2022-08-22 05:11:52', '2022-08-21 22:11:52', NULL),
(54, 5, '1661145156_FILE_DETAIL_WISATA.jpg', 'Ie Bu Peudah', '20000', 'Penduduk Aceh percaya bahwa Ie Bu Peudah sudah ada sejak zaman Kesultanan Aceh Darussalam. Panganan yang serig dijumpai pada ban suci Ramadhan ini memiliki citarasa hampir sama seperti bubur kanji rumbi. Ie Bu Peudah terbuat dari 44 jenis dedaunan yang ditumbuk dengan beras dan diendam di air kelapa. Dedaunan tersebut dicampur dengan bumbu rempah seperti jahe, kunyit, dan juga lada yang bermanfaat untuk menambah rasa segar dan stamina bagi siapapun yang menikmatinya.', 1, '2022-08-22 05:12:36', '2022-08-21 22:12:36', NULL),
(55, 7, '1661145374_FILE_DETAIL_WISATA.jpg', 'Koh Padee Season', '25000', 'Padi sudah mulai menguning yang artinya sudah siap untuk panen. Gampong Nusa menyediakan wisata edukasi panen padi. \r\nFasilitas :\r\n- Narasumber\r\n- Peralatan', 1, '2022-08-22 05:16:14', '2022-08-21 22:16:14', NULL),
(56, 7, '1661145460_FILE_DETAIL_WISATA.jpg', 'Camping', '40000', '2 hari 1 malam, minimal 5 orang\r\nFasilitas : air minum, air wudhu, toilet, apin unggun, sewa lokasi, guide.', 1, '2022-08-22 05:17:40', '2022-08-21 22:17:40', NULL),
(57, 7, '1661145532_FILE_DETAIL_WISATA.jpg', 'Pula Padee Season', '25000', 'Gampong Nusa menyediakan wisata edukasi menanam padi.\r\nFasilitas :\r\n- Narasumber\r\n- Peralatan', 1, '2022-08-22 05:18:52', '2022-08-21 22:18:52', NULL),
(58, 4, '1661303464_FILE_DETAIL_WISATA.jpg', 'Permainan Tradisional - Meen Karet', '30000', 'Meen Karet atau biasa disebut dengan lompat tali merupakan permainan tradisional yang serig dimainkan oleh anak-anak gampong Nusa. Tentu sudah jarang dimainkan oleh anak perkotaan, namun anda dapat bernostalgia dengan bermain bersama anak-anak Nusa, jadi mari berkunjung dan bergembira bersama.', 1, '2022-08-24 01:11:04', '2022-08-23 18:11:04', NULL);

