INSERT INTO `galery` (`id`, `nama_kegiatan`, `image`, `deskripsi`, `created_at`, `updated_at`) VALUES
(33, 'Pesantren Kilat Aceh Ramadhan Festival', '1661147958_FILE_GALLERY.jpg', '<p><span style=\'font-size:12.0pt;line-height:107%;\r\nfont-family:\"Times New Roman\",serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\r\nAR-SA\'>Pesantren kilat ini bertujuan untuk memperkenalkan nilai-nilai\r\nkebudayaan masyarakat Aceh sebagai destinasi wisata unggulan islami di\r\nIndonesia. Gampong Nusa, lokasi yang dipilih merupakan peraih juara pertama\r\nAnugerah Desa Wisata Indonesia (ADWI) Tahun 2021 kategori Home Stay. Peserta\r\nyang mengikuti pesantren kilat di Gampong Nusa ini diikuti oleh duta wisata\r\nAceh, influencer lokal hingga Nasional dan masyarakat umum. Mereka nantinya\r\nakan berbaur dengan masyarakat setempat.</span><p><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"2-1.jpg\"><span style=\'font-size:12.0pt;line-height:107%;\r\nfont-family:\"Times New Roman\",serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\r\nAR-SA\'><br></span>\r\n                                    </p></p>\n', '2022-08-21 22:59:18', '2022-08-21 22:59:18');
INSERT INTO `galery` (`id`, `nama_kegiatan`, `image`, `deskripsi`, `created_at`, `updated_at`) VALUES
(34, 'Festival kampung Nusa, The Art Colour of Sensation 2019', '1661148038_FILE_GALLERY.jpg', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\'font-size:12.0pt;\r\nline-height:107%;font-family:\"Times New Roman\",serif;mso-fareast-font-family:\r\n\"Times New Roman\";color:black;mso-fareast-language:EN-ID\'>Kegiatan yang\r\nmengangkat kearifan lokal lewat seni mural ini menjadi media promosi bagi\r\nGampong Nusa dan juga untuk dapat mengangkat ekonomi masyarakat. Kegiatan yang\r\nBertemakan The Art of Color Sensasion 2019 ini berlangsung selama dua hari,\r\n15-16 Juni 2019. Pada even ini, sejumlah pelukis mural dari berbagai komunitas\r\nseni di Aceh menyemarakkan The Art of Color Sensation 2019 di Gampong Nusa.\r\nMereka mengekspresikan diri membuat lukisan dengan nuansa keindahan alam\r\nGampong Nusa sebagai satu desa wisata di Aceh.</span><p class=\"MsoNormal\" style=\"text-align:justify\"><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"07b955898ae985d0fd99aa3993789cff.jpg\"><br></p></p>\n', '2022-08-21 23:00:38', '2022-08-21 23:00:38');
INSERT INTO `galery` (`id`, `nama_kegiatan`, `image`, `deskripsi`, `created_at`, `updated_at`) VALUES
