(36, 'Juara 1 Anugerah Desa Wisata Indonesia', '1661148735_FILE_GALLERY.jpg', '<span style=\'font-size: 12pt; line-height: 107%; font-family: \"Times New Roman\", serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\'>Gampong (Desa) Nusa,\r\nKecamatan Lhoknga, Kabupaten <span style=\'font-size:12.0pt;line-height:\r\n107%;font-family:\"Times New Roman\",serif;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-ID;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\'><a href=\"https://kumparan.com/topic/aceh\"><span style=\"color: windowtext;\">Aceh</span></a><span style=\"color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> Besar,\r\nmendapatkan prestasi juara 1 dalam Anugerah </span><a href=\"https://kumparan.com/topic/desa-wisata\"><span style=\"color: windowtext;\">Desa Wisata</span></a><span style=\"color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> Indonesia (ADWI)\r\n2021 kategori Homestay. Kabar gembira bagi Aceh ini diumumkan pada Malam ADWI\r\n2021 &acirc;&#128;&#152;Indonesia Bangkit&acirc;&#128;&#153; yang digelar di Ciputra Artpreneur, Jakarta, Selasa\r\n(7/12/2021) malam</span></span></span>\n', '2022-08-21 23:12:15', '2022-08-21 23:12:15');
