INSERT INTO `paket_wisata` (`id`, `nama`, `harga`, `deskripsi`, `itinenary`, `created_at`, `updated_at`) VALUES
(10, 'Live In 2D1N', '300000', 'Fasilitas : Homestay 1 malam, makan 3 kali, snack 2 kali, belajar memasak \r\ntimphan, kesenian budaya lokal, hiking, belajar daur ulang, guide', 'Check in pada sore hari di jemput oleh ibu homestay. Setelah magrib berkumpul untuk makan malam bersama dilanjutkan dengan kesenian budaya lokal. Pulang dan beristirahat di homestay masing-masing. Keesokan harinya jam 6 subuh hiking ke lhok umpee dan sarapan bersama di lhok umpee. Balik ke homestay dan bersiap-siap untuk kegiatan selanjutnya. Jam 9 berkumpul belajar memasak timphan dan daur ulang sampah. Jam 12 siang makan siang bersama dan check out.', '2022-08-21 22:33:14', '2022-08-21 22:33:14'),
(11, 'Camping Complete', '150000', '2 hari 1 malam, minimal 5 orang\r\nFasilitas : Air minum, , air wudhu, toilet, apin unggun, sewa lokasi, guide, tenda \r\ndhum, makan malam(ikan bakar)', 'Check in sore hari jam 4\r\nCheck out keesokan harinya jam 4', '2022-08-22 00:15:44', '2022-08-22 00:15:44'),
(12, 'Ramadhan di Nusa', '170000', 'Ramadhan di Nusa merupakan kegiatan menimba ilmu serta pengalaman terkait nilai budaya, adat istiadat dan kekhususan daerah Aceh dalam menyambut bulan suci Ramadhan. Anda nanti akan kita ajak berkeliling Gampong Nusa dan mengenalkan segala adat, budaya dan destinasi wisata di sini.\r\nFasilitas :\r\n-	Homestay\r\n-	Sahur\r\n-	Berbuka Bersama\r\n-	Ngabuburit Sore\r\n-	Tadarusan Bersama\r\n-	Transportasi Lokal\r\n-	Guide', 'Wisatawan check in di homestay setelah ashar, kemudian ngabuburit dan berbuka puasa bersama. Stelah berbuka puasa shalat teraweh berjamaah di meunasah dilanjutkan dengan tadarusan, untuk laki-laki di meunasah dan perempuan di TPA Alhayah, setelah itu kembali ke homestay dan beristirahat. Wisatawan sahur bersama pemilik homestay. Pagi harinya checkout.', '2022-08-22 00:18:14', '2022-08-22 00:18:14');

