INSERT INTO `sliders` (`id`, `title`, `deskripsi`, `image`, `created_at`, `updated_at`) VALUES
(7, 'Selamat Datang di Gampong Nusa', '<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; line-height: 21.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\'font-family:\"Calibri Light\",sans-serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-theme-font:\r\nmajor-latin;color:black;mso-color-alt:windowtext\'>Potensi lokal yang dimiliki\r\nterus diramu menjadi berbagai atraksi wisata dengan tujuan utama adalah\r\nmeningkatkan ekonomi masyarakat dan menjaga keberlanjutan lingkungan. Menikmati\r\nsuasana gampong, berinteraksi dengan warga dengan menginap di 45 <i>homestay</i>\r\nyaitu di rumah-rumah penduduk sebagai bagian akomodasi perjalanan wisatawan\r\nkian dikembangkan dengan mengikuti kaidah-kaidah kearifan lokal. Wisata edukasi\r\nseperti <i>cooking class, waste management package, traditional games</i>\r\nadalah atraksi wisata yang dapat dinikmati di Gampong Nusa. Tidak hanya hal\r\ntersebut, mencicipi makanan lokal dapat di reservasi melalui atraksi wisata <i>traditional\r\nfood</i>, souvenir kuliner. <i>Rural landscape</i> area dapat dinikmati melalui\r\natraksi <i>camping site, paddie field season</i>, potensi sungai dan\r\nsebagainya. Nuansa budaya lokal lainnya dapat juga diperoleh melalui atraksi\r\nmeugang day, Qurban Moments dan atraksi adat seperti moment kandhuri maulid,\r\nkhanduri pade atau adat perkawinan merupakan atraksi wisata yang sangat menarik\r\nuntuk Anda kunjungi.</span></p>\n', '1661143091_FILE_SLIDER.jpg', '2022-08-21 21:38:11', '2022-08-21 21:38:11'),
(8, 'Juara 1 Anugerah Desa Wisata Indonesia', '<span style=\'font-size:12.0pt;line-height:107%;\r\nfont-family:\"Times New Roman\",serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:\r\nAR-SA\'>Kementerian Pariwisata dan Ekonomi Kreatif/Badan Pariwisata Ekonomi\r\nKreatif Republik Indonesia memberikan anugerah penghargaan kepada Gampong Nusa,\r\nKecamatan Lhoknga, Aceh Besar sebagai peraih juara pertama kategori homestay\r\npada malam Anugerah Desa Wisata Indonesia tahun 2021.</span>\n', '1661147538_FILE_SLIDER.jpg', '2022-08-21 22:49:47', '2022-08-21 22:52:18'),
(9, 'Bapak Menteri Sedang Masak Kuah Beulangong', '<span style=\'font-size: 12pt; line-height: 107%; font-family: \"Times New Roman\", serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\'>Menteri Pariwisata\r\ndan Ekonomi Kreatif (Menparekraf) <span style=\'font-size:11.0pt;\r\nline-height:107%;font-family:\"Calibri\",sans-serif;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-font-family:\"Times New Roman\";mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\'><a href=\"https://kumparan.com/topic/sandiaga-uno\"><span style=\'font-size: 12pt; line-height: 107%; font-family: \"Times New Roman\", serif; color: windowtext;\'>Sandiaga Uno</span></a></span><span style=\'font-size: 12pt; line-height: 107%; font-family: \"Times New Roman\", serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\'>, melakukan kunjungan kerja ke </span><span style=\'font-size:11.0pt;line-height:107%;font-family:\"Calibri\",sans-serif;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\"Times New Roman\";\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-ID;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\'><a href=\"https://kumparan.com/topic/aceh\"><span style=\'font-size: 12pt; line-height: 107%; font-family: \"Times New Roman\", serif; color: windowtext;\'>Aceh</span></a></span><span style=\'font-size: 12pt; line-height: 107%; font-family: \"Times New Roman\", serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\'>. Sandi mengunjungi </span><span style=\'font-size:11.0pt;line-height:107%;font-family:\"Calibri\",sans-serif;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\"Times New Roman\";\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-ID;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\'><a href=\"https://kumparan.com/topic/desa-wisata\"><span style=\'font-size: 12pt; line-height: 107%; font-family: \"Times New Roman\", serif; color: windowtext;\'>desa wisata</span></a></span><span style=\'font-size: 12pt; line-height: 107%; font-family: \"Times New Roman\", serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\'> Gampong Nusa di Kecamatan Lhoknga, Kabupaten\r\nAceh Besar, Aceh, Rabu (20/10) pagi. </span><span class=\"textwebstyledtext-sc-1uxddwr-0\"><span style=\'font-size:12.0pt;line-height:\r\n107%;font-family:\"Times New Roman\",serif;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-ID;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\'>Gampong Nusa merupakan desa wisata yang terpilih\r\nmasuk 50 besar dalam Anugerah Desa Wisata Indonesia (ADWI) 2021 yang digelar\r\noleh Kemenparekraf RI. Kunjungan </span></span><span style=\'font-size:11.0pt;\r\nline-height:107%;font-family:\"Calibri\",sans-serif;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-font-family:\"Times New Roman\";mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:EN-ID;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\'><a href=\"https://kumparan.com/topic/menparekraf\"><span style=\'font-size: 12pt; line-height: 107%; font-family: \"Times New Roman\", serif; color: windowtext;\'>Menparekraf</span></a></span><span class=\"textwebstyledtext-sc-1uxddwr-0\"><span style=\'font-size:12.0pt;line-height:\r\n107%;font-family:\"Times New Roman\",serif;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-ID;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\'> Sandiaga Uno bersama tim juri ADWI 2021 ke\r\nGampong Nusa dalam kunjungan kerjanya di Aceh untuk melakukan peninjauan dan\r\npenilaian langsung ke desa Nusa. Terlihat pada foto Bapak Menter sedang memasak kuah beulangong.</span></span></span>\n', '1661382273_FILE_SLIDER.jpg', '2022-08-24 16:04:33', '2022-08-24 16:04:33');

